DROP TABLE ufile;
DROP TABLE tuser;

CREATE TABLE tuser (
    userno NUMBER PRIMARY KEY
    , userid VARCHAR2(200) NOT NULL
    , userpw VARCHAR2(500) NOT NULL
    , username VARCHAR2(200) NOT NULL
    , useremail VARCHAR2(100) NOT NULL
    , userphone VARCHAR2(50) NOT NULL
    , useraddr1 VARCHAR2(10) NOT NULL
    , useraddr2 VARCHAR2(4000) NOT NULL
    , useraddr3 VARCHAR2(4000)
    , usergender VARCHAR2(1)
    , userbirth VARCHAR2(50)
    , usernick VARCHAR2(200)
    , usergrade VARCHAR2(20) NOT NULL
    , userjoindate DATE DEFAULT sysdate NOT NULL
    , userupdate DATE
    , reportcount NUMBER
);

DROP SEQUENCE tuser_seq;
CREATE SEQUENCE tuser_seq;

SELECT * FROM tuser;

DELETE tuser;


commit;

SELECT * FROM tuser
ORDER BY userno;



